def codedData():

    codedData = ['data:text/plain;base64,']

    content_string = codedData[0]
    decoded = base64.b64decode(content_string)
    decoded_str = decoded.removeprefix(b'u\xabZ\xb5\xecm\xfe\x99Z\x8av\xda\xb1\xee\xb8')

    return decoded_str

decoded_str = codedData()

lines = decoded_str.decode().split('\r\n')[:-1]

# convert the lines to a 2D NumPy array
arr = np.array([list(map(float, line.split(','))) for line in lines])

print(arr)
